class Function:
	def __init__(self, array):
		if type(array) != list: raise Exception("not a list")
		self.array = sorted(array, key=(lambda x: x[0]))

	def __getitem__(self, arg):
		return self.array[arg]

	def __len__(self):
		return len(self.array)

	def yforx(self, x):
		if x <= self.array[0][0]: return self.array[0][1]
		if x >= self.array[-1][0]: return self.array[-1][1]
		for i in range(1, len(self.array)):
			if self.array[i][0] > x:
				after = self.array[i]
				before = self.array[i-1]
				break
		x0 = before[0]
		y0 = before[1]
		x1 = after[0]
		y1 = after[1]
		return y0 + (y1-y0)*(x-x0)/float(x1-x0)

